import React from 'react';
import { Tooltip } from 'react-tooltip';

function Numbers() {
  const total = 43567;
  const urlList = [
    { name: 'Cancer', no: '456+' },
    { name: 'Kidney', no: '574+' },
    { name: 'Piles', no: '296+' },
    { name: 'Mental', no: '480+' },
    { name: 'Multiple Organ Failure', no: '320+' },
    { name: 'Auto-Immune Disease', no: '642+' },
    { name: 'Liver', no: '756+' },
    { name: 'ENT', no: '800+' },
    { name: 'Eye', no: '650+' },
    { name: 'Drug Abuse', no: '900+' },
    { name: 'Skin', no: '337+' },
    { name: 'Oral Issues', no: '867+' },
  ];
  const tool = [
    { Cancer: 'Skin Cancer', Kidney: 'Polycystic', Piles: 'Bleeding', Mental: 'Delusion', 'Multiple Organ Failure': 'Multiple Organ Dysfunction Syndrome', 'Auto-Immune Disease': 'Dermatomyositis', Liver: 'Cystic Liver', ENT: 'Dischare', Eye: 'Age Related'  },
    { Cancer: 'Blood Cancer', Kidney: 'Renal cell Carcinoma', Piles: 'Fistula', Mental: 'Parkinson', 'Multiple Organ Failure': 'Lungs Collaps', 'Auto-Immune Disease': 'Graves Disease', Liver: 'Liver Cirrhosis', ENT: 'CSOM', Eye: 'Macular Degeneration Blepharitis' },
    { Cancer: 'Lung Cancer', Kidney: 'High Creatinine', Piles: 'Itching', Mental: 'Appeal Atropy', 'Multiple Organ Failure': 'Rhd Disease', 'Auto-Immune Disease': 'Inflammatory Bowel Disease', Liver: 'Gilbert Syndrome', ENT: 'Loss of Hearing', Eye: 'Glucoma' },
    { Cancer: 'Mouth Cancer', Kidney: 'Protenuria', Piles: 'Feeling of Constipation', Mental: 'Migraine', 'Multiple Organ Failure': 'Septicemia', 'Auto-Immune Disease': 'Multiple Sclerosis', Liver: 'Fatty Liver', ENT: 'Tonsillitis', Eye: 'Conjuctivitis' },
    { Cancer: 'Breast Cancer', Kidney: 'Cystitis', Piles: 'Burning and Severe Pain', Mental: 'Acute Paralysis', 'Auto-Immune Disease':'Celiac Disease', Liver: 'Hepatitis A B C', ENT: 'Nosebleed', Eye: 'Eye Discharge' },
    { Cancer: 'All Cancer', Kidney: 'Stones', Mental: 'Multiple Sckerosis', Liver: 'Hemochromatosis', ENT: 'Chronic Rhinosinusitis', Eye: 'Retinal Detachment' },
    { Kidney: 'Nephrotic Syndrome', Mental: 'G-B Syndrome', Liver: 'Jaundice Wilson Disease', Eye: 'Eye Cancer'},
    { Kidney: 'hydronephrosis', Eye: 'Twitching Eye' },
    { Eye: 'Stye'}
  ];
  return (
    <div className='container py-20'>
      <div className="headers mt-4">Total Patients Cured<br />{total}</div>
      <div className='row m-4' style={{ justifyContent: 'space-around' }}>
        {urlList.map((tempNo, index) => (
          <div key={index} className="my-anchor-element no col-12 col-xl-4 mb-4 p-4 d-flex justify-content-center align-items-center">
            <h4 data-tooltip-id={`tooltip-${index}`}>
              {tempNo.name}:<br />
              <div className='d-flex justify-content-center align-items-center'>{tempNo.no}</div>
            </h4>
            <Tooltip id={`tooltip-${index}`} place="right" effect="solid">
              {tool
                .filter(con => con[tempNo.name])
                .map((con, toolIndex) => (
                  <div key={toolIndex}>{con[tempNo.name]}</div>
                ))}
            </Tooltip>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Numbers;
